const Thankyou = () => {
    return ( 
        <React.Fragment>
        <div>
            [Dimestore]
        </div>
        <div>
            THANK YOU <br/>
            for shopping with us
        </div>
        </React.Fragment>
     );
}
 
export default Thankyou;
